import { ProductList, PageHeader } from "./components/PageHeader";
import { Footer, Home } from "./components/Home";
function App() {
  return (
    <div className="App">
      <PageHeader title="App Tittle" />
      <ProductList></ProductList>
      <Home text="Cool APP" />
      App component Work!
      <Footer></Footer>
    </div>
  );
}

export default App;
